const MainLayout = () => {

  const paymentModalRef = useRef();

  return (
    <div className= "overflow-hidden w-screen h-screen">
        <Header paymentModalRef={paymentModalRef}/>
        <Outlet/>
        <Footer/>
    </div>
  )
}

export default MainLayout
